The Sex Pistols are an English punk rock band that formed in London in 1975. The band originally comprised vocalist Johnny Rotten, guitarist Steve Jones, drummer Paul Cook and bassist Glen Matlock (replaced by Sid Vicious). Although their initial career lasted only three years and produced only four singles and one studio album, Never Mind the Bollocks, Here&amp;#039;s the Sex Pistols, the Sex Pistols have been described by the BBC as &quot;the definitive English punk rock band.&quot; The Pistols are widely credited with initiating the punk movement in the United Kingdom and creating the first generation gap within rock and roll.



